selector_to_html = {"a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Holen Sie sich die Firmware-Version<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#character-encoding-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Zeichenkodierungseinstellungen<a class=\"headerlink\" href=\"#character-encoding-settings\" title=\"Link to this heading\">#</a></h2><h3>GBK(GB2312)<a class=\"headerlink\" href=\"#gbk-gb2312\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologien<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>1D Symbologien<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tastentrigger-Modus<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Dr\u00fccken Sie die Schaltfl\u00e4che, um das Scannen auszul\u00f6sen, und lassen Sie die Taste zum Scannen frei. Das Scannen endet wenn der Scan erfolgreich ist oder die Lesezeit die einzelne Lesezeit \u00fcbersteigt.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tastatursprache<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Chinesisch<a class=\"headerlink\" href=\"#chinese\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Standardeinstellungen wiederherstellen<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Wenn ein unbekannter Fehler auf dem Scanner auftritt, k\u00f6nnen Sie den Scanner zur\u00fccksetzen, indem Sie die Standardeinstellungen wiederherstellen.</p>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Systemeinstellungen<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Standardeinstellungen wiederherstellen<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Wenn ein unbekannter Fehler auf dem Scanner auftritt, k\u00f6nnen Sie den Scanner zur\u00fccksetzen, indem Sie die Standardeinstellungen wiederherstellen.</p>", "a[href=\"system.html#aiming-light\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Zielendes Licht<a class=\"headerlink\" href=\"#aiming-light\" title=\"Link to this heading\">#</a></h2><h3>Aktivieren<a class=\"headerlink\" href=\"#id2\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">1D Symbologien<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#nt-12895-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>NT-12895</strong> kabelgebundene Scanner-Schnelleinstellungsanleitung<a class=\"headerlink\" href=\"#nt-12895-wired-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"scanmode.html#scanning-interval\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Scan-Intervall<a class=\"headerlink\" href=\"#scanning-interval\" title=\"Link to this heading\">#</a></h2><p>Arbeitsverz\u00f6gerung beim Scannen verschiedener Barcodes</p>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Tastatureinstellungen<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Zeichenkodierungseinstellungen<a class=\"headerlink\" href=\"#character-encoding-settings\" title=\"Link to this heading\">#</a></h2><h3>GBK(GB2312)<a class=\"headerlink\" href=\"#gbk-gb2312\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#lighting-light\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Lichtlicht<a class=\"headerlink\" href=\"#lighting-light\" title=\"Link to this heading\">#</a></h2><h3>Aktivieren<a class=\"headerlink\" href=\"#enable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End-Charakter-Einstellungen<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Das End-Zeichen wird nach den dekodierten Daten im Format der dekodierten Daten + End-Zeichen hinzugef\u00fcgt.</p>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Kontinuierlicher Modus<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>Wenn der Scanner erfolgreich ist oder die Scanzeit die Arbeitszeit \u00fcberschreitet, endet der aktuelle Scanner. Wenn die Zeit die angegebene Zeit \u00fcberschreitet, wird der n\u00e4chste Scan automatisch ausgel\u00f6st.</p>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan-Modus<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Tastentrigger-Modus<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Dr\u00fccken Sie die Schaltfl\u00e4che, um das Scannen auszul\u00f6sen, und lassen Sie die Taste zum Scannen frei. Das Scannen endet wenn der Scan erfolgreich ist oder die Lesezeit die einzelne Lesezeit \u00fcbersteigt.</p>", "a[href=\"system.html#usb-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">USB-Modus<a class=\"headerlink\" href=\"#usb-mode\" title=\"Link to this heading\">#</a></h2><h3>USB-Tastatur<a class=\"headerlink\" href=\"#usb-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminator<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>End-Charakter-Einstellungen<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Das End-Zeichen wird nach den dekodierten Daten im Format der dekodierten Daten + End-Zeichen hinzugef\u00fcgt.</p>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Lautst\u00e4rke-Einstellungen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><h3>Geringe Lautst\u00e4rke<a class=\"headerlink\" href=\"#low-volume\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">2D Symbologien<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barcodes mit URLs blockieren<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Link to this heading\">#</a></h2><p>Blockiere das Scannen von URL-QR-Codes, beginnend mit <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"barcode.html#reversal-barcode-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barcode-Einstellungen umkehren<a class=\"headerlink\" href=\"#reversal-barcode-settings\" title=\"Link to this heading\">#</a></h2><h3>Kein Support Reversal Barcode<a class=\"headerlink\" href=\"#no-support-reversal-barcode\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Automatischer Sensormodus<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>Im Automatik-Sensing-Modus erkennt der Scanner die Helligkeit der umgebenden Umgebung. Wenn sich die Helligkeit \u00e4ndert, wird der Scan ausgel\u00f6st. Der Scan endet wenn der Scan erfolgreich ist oder die Scanzeit die Arbeitszeit \u00fcbersteigt. Unabh\u00e4ngig davon, ob der letzte Scan erfolgreich war oder fehlgeschlagen ist, wird die Helligkeit der umgebenden Umgebung erneut erkannt.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
